"use strict";

function dominantIndex(nums) {
    let mx = 0, mid = 0, ans = -1;
    for (let i = 0; i < nums.length; i++) {
        let v = nums[i];
        if (v > mx) {
            mid = mx;
            mx = v;
            ans = i;
        } else if (v > mid) {
            mid = v;
        }
    }
    return mx >= 2 * mid ? ans : -1;
}
